import React from 'react';
import Header from './Header';

function App() {

  var contador;

  function incrementCounter(contador) {
    contador++;
  }

  return (

    <>
     <h1>{contador}</h1>
     <button onClick={incrementCounter(contador)}></button>
    </>

  );
}

export default App;
